import React, {useState} from 'react';
import './home.css';
import {useNavigate} from 'react-router-dom';

function homePage(){ 

    const navigate = useNavigate();

    const [mbti,setMbti]= useState(['','','','']);
    const clickMbti =(e)=>{
      setMbti(e.target.value);
    }
    return (
      <div className="Home">
        <div className="upperTitle">
          <p>MBTI</p>
          <button onClick={()=>navigate('/admin')}>
            관리자 페이지</button>
        </div>

        <div className="chooseMbti">
          <div className="upperMbti"> 
             <button className={'energy'} value={'E'} onClick={clickMbti}>E</button>
             <button className={'recognition'} value={'S'} onClick={clickMbti}>S</button>
             <button className={'decision'} value={'T'} onClick={clickMbti}>T</button>
             <button className={'lifestyle'} value={'J'} onClick={clickMbti}>J</button>
          </div>

          <div className="meanMbti">
            <p>에너지 방향</p>
            <p>인식 방식</p>
            <p>판단</p>
            <p>생활 양식</p>
          </div>

           <div className="lowerMbti">
              <button className={'energy'} value={'I'} onClick={clickMbti} >I</button>
              <button className={'recognition'} value={'N'} onClick={clickMbti}>N</button>
              <button className={'decision'} value={'F'} onClick={clickMbti}>F</button>
              <button className={'lifestyle'} value={'P'} onClick={clickMbti}>P</button>
           </div>

           <div className="okBtn">
              <input type='submit' value={"확인"} onClick={()=>navigate('/result')}/>
           </div>
        </div>

        <div className="lowerTitle"></div>
      </div>
    );
};

export default homePage;
